elif(command[0]=="remove"):
    for i in a:
        if(i==command[1]):
            a.remove(i)
elif(command[0]=="swap"):
    if(command[1] in a and command[2] in a):
        index1=a.index(command[1])
        index2=a.index(command[2])
        temp=a[index1]
        a[index1]=a[index2]
        a[index2]=temp
