  if a == "add":
    num1.append(b)
  elif a == "remove":
    num1.remove(b)
  elif a =="swap":
    i = num1.index(c)
    j = num1.index(b)
    num1.insert(i+1,b)
    num1.pop(i)
    num1.insert(j+1,c)
    num1.pop(j)


